import React, { useReducer } from 'react';
import logo from './logo.svg';
import './App.css';
import PageLayout from './PageLayout.js'
import Home from './Home.js';

export default function App() {
  const [windows, dispatch] = useReducer(windowsReducer, ['home', 'home', 'home', 'home']);
  return (
    <PageLayout>
      <div style={{
        display: 'grid',
        gridTemplateColumns: '1fr 1fr',
        gridTemplateRows: '1fr 1fr',
        gridTemplateAreas: `'a0 a1' 'a2 a3'`,
        gap: '1em',
        maxHeight: '100%',
        gridArea: 'screen',
        border: '5px solid blue'
      }}>
        {windows.map((i, index) => <div key={index.toString} style={{
          gridArea: 'a' + index,
          border: '5px solid green',
          padding: '0.5em',
          overflow: 'scroll'
        }}>
          {i === 'home' &&
            <Home></Home>
          }
        </div>)}
      </div>
    </PageLayout>
  );
}

function windowsReducer(windows, action) {
  switch (action.type) {
    case 'add': {
      return windows.with(action.position, action.newScreen);
    }
    case 'remove': {
      return windows.with(action.position, "");
    }
    default: {
      throw Error('Unknown action in windowsReducer: ' + action.type);
    }
  }
}
